import { SET_LIST_TO_BE_UPDATED } from "../../actions/actionTypes";

export default (list = [], action) => {
	switch (action) {
		case SET_LIST_TO_BE_UPDATED:
			return actions.payload;
		default:
			return list;
	}
};
